 // Import the useEffect and useState hooks from React
import React, { useEffect, useState } from 'react';
// Import the Link component from react-router-dom for navigation
import { Link } from 'react-router-dom';

// Define and export the PostList component
export default function PostList() {
    return (
        // The body element of the HTML document
        <body>
            {/* Main container div with a class name "container" */}
            <div className="container">
                {/* Header element with a class name "header" */}
                <h3 className="header">APDS Notice Board</h3>
                {/* Table element with a class name "table table-striped" and inline style for margin */}
                <table className="table table-striped" style={{ marginTop: 20 }}>
                    {/* Table header */}
                    <thead>
                        <tr>
                            {/* Table header cells */}
                            <th>User</th>
                            <th>Caption</th>
                            <th>Image</th>
                            <th>Actions</th> {/* This column will contain the actions for each post */}
                        </tr>
                    </thead>
                    {/* Table body will be added here in the future */}
                </table>
            </div>
        </body>
    );
}
